import React from "react";
import { Link } from "react-router-dom";
import "../styles/Dashboard.css";

const Dashboard = () => {
  return (
    <div className="dashboard">
      <h1>SWE-SYS Dashboard</h1>
      <div className="dashboard-grid">
        <div className="dashboard-card">
          <h2>üë• Teachers</h2>
          <p>Manage teacher information and availability</p>
          <Link to="/teachers">View Teachers</Link>
        </div>
        <div className="dashboard-card">
          <h2>üìö Courses</h2>
          <p>Browse and manage course offerings</p>
          <Link to="/courses">View Courses</Link>
        </div>
        <div className="dashboard-card">
          <h2>üè´ Classrooms</h2>
          <p>View and manage classroom resources</p>
          <Link to="/classrooms">View Classrooms</Link>
        </div>
        <div className="dashboard-card">
          <h2>üìÖ Schedules</h2>
          <p>View and manage class schedules</p>
          <Link to="/schedules">View Schedules</Link>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
